    constructor() {
        this._loadDatabase();
    }

    async _loadDatabase() {
        this.client = new MongoClient(uri);
        await this.client.connect()
        this.database = this.getDatabase(DB_NAME);
    }

    getDatabase(dbName) {
        return this.client.db(dbName);
    }

    getCollection(collecitonName) {
        return this.database.collection(collecitonName);
    }

}

